(5, 'upload/1cbc283114.jpg', 'Abdur Rouf Ahmed', 'Adviser(MD) & Director.', 'Shadhin Bahumukhi Firm', 'Kaisarnagor, Saihamnagor, Madhabpur, Habigonj.', 'uzzal_it@gmail.com', 'www.sbf2014.com', 'Business', 'Ragob ali <br/> Mises. Juhora Khaton', '0000-00-00', 25, 'Married', 'Miss. Suma Khaton', 'Good', 'Good', 'Good', 'Dhaka, Gulshan', '<div class="style1" align="justify">Shadhin Bahumukhi Firm is one of the marketing companies of the Country. One Thousand Distributors have joined the company since its inception in April 2015. Having its corporate office in Dhaka Bangladesh, it has branch in Madhabpur, Habigonj.&nbsp;</div>\r\n<div class="style1" align="justify">&nbsp;</div>\r\n<div class="style1" align="justify">With the goal to create self-employment opportunities for millions of educated-unemployed youths of Bangladesh, the company started its journey on a very rough road. Since the marketing concept was new in Bangladesh, the company started to face with many difficulties from the beginning. The concept was misunderstood by many people.&nbsp;</div>\r\n<div class="style1" align="justify">&nbsp;</div>\r\n<div class="style1" align="justify">However, under the dynamic leadership of its Managing Director, Mr. Muklisur Rahman, the company could overcome those, and made a remarkable progress down the road.</div>');

