INSERT INTO `tbl_aboutpage` (`id`, `title`, `body`, `name`) VALUES
(1, 'Oishi Software &amp; Technology', '&lt;p style=&quot;text-align: justify;&quot;&gt;Dear Visitor,&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;Welcome to the website of &lt;strong&gt;Oishisoftech.com&lt;/strong&gt; and thank you for your interest. This site will give you an excellent insight about our company and its capabilities.&lt;/p&gt;\r\n&lt;p&gt;The mission of &lt;strong&gt;Oishi Software &amp;amp; Technology&lt;/strong&gt; is to exceed customer expectations by providing outstanding customer care through innovations created by talented, qualified employees. We believe that our customer&amp;rsquo;s satisfaction and thus their loyalty are our success.&lt;/p&gt;\r\n&lt;p&gt;Our overall business attitude is shaped by our overall value care. The people of &lt;strong&gt;Oishi Software &amp;amp; Technology&lt;/strong&gt; understand that, in the long run, success in business can only be achieved by maintaining service quality and long- term client relations. Some of our services for which we are looked out for are &lt;strong&gt;Software Development, Website Designing, E-commerce Solution, Bulk E-mail and SMS Service, Search Engine Optimization, Domain &amp;amp; Hosting Providing etc.&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Thank you for visiting our website and for considering our products and services. I encourage you to experience the caring attitude of our competent, dedicated employees. We welcome the opportunity to answer any questions you may have and discuss your needs. Please let us know how we can be of assistance to you.&lt;/p&gt;\r\n&lt;p&gt;Sincerely,&lt;br /&gt; &lt;strong&gt;Md Uzzal&lt;/strong&gt;&lt;br /&gt; &lt;strong&gt;Founder &amp;amp; Director&lt;/strong&gt;&lt;br /&gt; &lt;strong&gt;Oishi Software &amp;amp; Technology&lt;/strong&gt;&lt;br /&gt; &lt;strong&gt;Mob:&lt;/strong&gt; +8801923243545 &lt;br /&gt; &lt;strong&gt;Mob:&lt;/strong&gt; +8801725256292&lt;/p&gt;', 'upload/name.jpg');

