(95, 3, 'Oishi Software & Technology', '<pre><span style="font-family: arial,helvetica,sans-serif;">Dear Visitor,</span></pre>\r\n<pre><span style="font-family: arial,helvetica,sans-serif;">Welcome to the website of <strong>Oishisoftech.com</strong> and thank you for your interest. This site will give you an excellent insight about our company and its capabilities.</span></pre>\r\n<pre><span style="font-family: arial,helvetica,sans-serif;">The mission of <strong>Oishi Software &amp; Technology</strong> is to exceed customer expectations by providing outstanding customer care through innovations created by talented, qualified employees. We believe that our customer&rsquo;s satisfaction and thus their loyalty are our success.</span></pre>\r\n<pre><span style="font-family: arial,helvetica,sans-serif;">Our overall business attitude is shaped by our overall value care. The people of <strong>Oishi Software &amp; Technology</strong> understand that, in the long run, success in business can only be achieved by maintaining service quality and long- term client relations. Some of our services for which we are looked out for are <strong>Software Development, Website Designing, E-commerce Solution, Bulk E-mail and SMS Service, Search Engine Optimization, Domain &amp; Hosting Providing etc.</strong></span></pre>\r\n<pre><span style="font-family: arial,helvetica,sans-serif;">Thank you for visiting our website and for considering our products and services. I encourage you to experience the caring attitude of our competent, dedicated employees. We welcome the opportunity to answer any questions you may have and discuss your needs. Please let us know how we can be of assistance to you.</span></pre>\r\n<pre><span style="font-family: arial,helvetica,sans-serif;">Sincerely,</span><br /><span style="font-family: arial,helvetica,sans-serif;"> <strong>Md Uzzal</strong></span><br /><span style="font-family: arial,helvetica,sans-serif;"> <strong>Founder &amp; Director</strong></span><br /><span style="font-family: arial,helvetica,sans-serif;"> <strong>Oishi Software &amp; Technology</strong></span><br /><span style="font-family: arial,helvetica,sans-serif;"> <strong>Mob:</strong> +8801923243545 </span><br /><span style="font-family: arial,helvetica,sans-serif;"> <strong>Mob:</strong> +8801725256292</span></pre>', 'upload/e13d9ca3d7.jpg', 'uzzal.skcl', 'jibikasupershop', '2017-05-28 12:09:40', 31);

